script: |
  super -f text -I q5628.spq | sort > q5628.out

inputs:
  - name: q5628.spq
    data: |
      SELECT ALL - + 58 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT 59 + col2 * + col0 IN ( + - ( 37 ), + ( - col2 ) + - 94 + col0 + - col2 * - ( - 40 ) );
  - name: tab0

outputs:
  - name: q5628.out
    data: |
      -58
      -58
      -58
